import logging
from xml.etree import ElementTree as ET

import pytest

from pymisclib.xmlutils import log_xml


@pytest.fixture
def logger():
    """Fixture for creating a logger instance."""
    logger = logging.getLogger('pymisclib.xmlutils')
    logger.propagate = True  # see https://stackoverflow.com/a/64424291
    yield logger


@pytest.fixture
def xml_elem():
    """Fixture for creating an XML element instance."""
    elem = ET.Element('elem',
                      attrib={'foo': 'foo', 'bar': 'bar', 'baz': 'yo!'})
    child1 = ET.SubElement(elem, 'child1')
    child1.text ='Child 1 text'
    child2 = ET.SubElement(elem, 'child2')
    ET.SubElement(child2, 'child2-3',
                  attrib={'a': '1', 'b': '2', 'c': '3'})
    return elem

@pytest.fixture
def xml_string():
    """String for creating an XML string instance."""
    return """<elem foo="foo" bar="bar" baz="yo!">
  <child1>Child 1 text</child1>
  <child2>
    <child2-3 a="1" b="2" c="3" />
  </child2>
</elem>"""


@pytest.mark.parametrize('indent', [0, 1, 2, 3, 4, 5, 8, 12])
def test_log_xml_indent(caplog, logger, xml_elem, xml_string, indent: int):
    """Test XML logging with different levels of indent."""
    with caplog.at_level(logging.DEBUG):
        log_xml(logger, xml_elem, level=logging.DEBUG, indent=indent)

    indent_str = ' ' * indent
    expected_lines = [indent_str + l for l in xml_string.splitlines()]
    actual_lines = [r.message for r in caplog.records]
    for e, a in zip(expected_lines, actual_lines):
        assert a == e


