def test_log_xml_weird(caplog, logger, input, expected):
    """Test some weird XML constructs."""
    try:
        xml_elem = ET.XML(input)
    except Exception as e:
        assert False
    with caplog.at_level(logging.DEBUG):
        log_xml(logger, xml_elem, level=logging.DEBUG, indent=0)

    expected_lines = expected.splitlines()
    actual_lines = [r.message for r in caplog.records]
    for e, a in zip(expected_lines, actual_lines):
        assert a == e
